struct OutputData {
    std::vector<int> Q_wektor;
    std::vector<int> S_wektor;
    std::vector<int> QRSonset_wektor;
    std::vector<int> QRSend_wektor;
    std::vector<int> P_wektor;
    std::vector<int> Pend_wektor;
    std::vector<int> Ponset_wektor;
    std::vector<int> T_wektor;
};


OutputData doCalculations() {

    OutputData results;
    std::vector<double> pomocniczySQ;
 

    int okno=0;
    int odl=0;
    int odlSQ=0;
    int szuk_przed=0;
    int kontroler=0;
    double max_war=0;
    int max_poz=0;
    int iterator=0;
    double mediana=0;

	    for (int i=0; i<R_wektor.size(); i++)
    {
        
        //odleglosc miedzy R
        if (i == 0)
        {
            odl = R_wektor [0];
        }
        else 
        {
            odl = R_wektor [i] - R_wektor[i-1];
        }


         okno = 2; 
       
        // szukanie wektora Q

        while (R_wektor[i]-okno-1>=0 && okno<= odl*0.2 )
        {
            if (sygnal[R_wektor[i]-okno] < sygnal[R_wektor[i]-okno-1] && okno>=odl*0.01) 
                {results.Q_wektor.push_back(R_wektor[i] - okno); kontroler=1;break;}
            okno=okno+1;

        }

        if (kontroler == 0)
        {
            results.Q_wektor.push_back(R_wektor[i] - okno);
        }


        //szukanie wektora S
        okno = 0; 
        kontroler=0;

        while (R_wektor[i]+okno+1<sygnal.size() && okno<=odl*0.3) //poprawic, bo czasem zbyt malo
        {
            if (sygnal[R_wektor[i]+okno] < sygnal[R_wektor[i]+okno+1] && okno>=odl*0.01)
            {
                results.S_wektor.push_back(R_wektor[i]+okno);
                kontroler=1;
                break;
            }
            okno=okno+1;
        }

        if (kontroler == 0)
        {
            results.S_wektor.push_back(R_wektor[i] + okno);
        }

            //szukanie wektora P

        okno = 0;
        kontroler=0;
        pomocniczySQ.clear();

          //odleglosc S_Q
            if (i == 0)
                {odlSQ = results.Q_wektor[i];}
            else
                {odlSQ = results.Q_wektor[i]-results.S_wektor[i-1];}


            if (i == 0)   
            {
                for (int a=0; a<odlSQ; a++)
                {pomocniczySQ.push_back(sygnal[a]);}
            }
            else 
            {
                szuk_przed=odlSQ/3;

                for (int a=results.Q_wektor[i]-szuk_przed; a<results.Q_wektor[i]; a++)
                {  
                    pomocniczySQ.push_back(sygnal[a]);
                }
            }


           // szukanie max - P
         max_war=pomocniczySQ[0];
         max_poz=0;
         iterator=0;

         while (iterator<pomocniczySQ.size())
         {

             if (pomocniczySQ[iterator]>max_war)
             {
                 max_war=pomocniczySQ[iterator];
                 max_poz=iterator;
                 
             }
             iterator=iterator+1;

         }

         // wypelnianie wektora P
         if (i==0)
         {
             results.P_wektor.push_back(max_poz); //czy w tej sytuacji wpisywac na pewno 0?
         }
         else
         {
             results.P_wektor.push_back(results.Q_wektor[i]-szuk_przed+max_poz);
         }


        //szukanie mediany
        std::nth_element(pomocniczySQ.begin(), pomocniczySQ.begin() + pomocniczySQ.size()/2, pomocniczySQ.end());
        mediana= pomocniczySQ[pomocniczySQ.size()/2];

        //P_end
         okno=0;
         while(results.P_wektor[i]+okno+1<sygnal.size() && results.P_wektor[i]+okno<R_wektor[i])
         { //uwaga na odwrcona proporcje przy wymnazaniu!!!
             if(sygnal[results.P_wektor[i]+okno]<mediana) 
             {results.Pend_wektor.push_back(results.P_wektor[i]+okno);break;}
             okno=okno+1;
         }

         // QRS_onset

         okno=0;
         while(results.Q_wektor[i]-okno>0 && results.Q_wektor[i]-okno>results.P_wektor[i])
         {
             if (sygnal[results.Q_wektor[i]-okno]>sygnal[results.Q_wektor[i]-okno-1] && sygnal[results.Q_wektor[i]+okno]>mediana)
             {results.QRSonset_wektor.push_back(results.Q_wektor[i]-okno); break;}

             okno=okno+1;
         }

         // P_onset

         okno=0;

         while (results.P_wektor[i]-okno-1>=0) //tutaj moznaby pomyslec nad inna mediana i warunkami
         {
             if (sygnal[results.P_wektor[i]-okno]<sygnal[results.P_wektor[i]-okno-1] && sygnal[results.P_wektor[i]-okno<mediana])
             {
                 results.Ponset_wektor.push_back(results.P_wektor[i]-okno);
                 break;
             }

             okno=okno+1;

         }

        // zamlamek T

        //wypelnianie pomocniczego

        pomocniczySQ.clear();

        if (i == 0)   
            {
                for (int a=0; a<odlSQ; a++)
                {pomocniczySQ.push_back(sygnal[a]);} //nalozy sie P i T
            }
            else 
            {
                szuk_przed=odlSQ/2;

                for (int a=results.S_wektor[i-1]+szuk_przed*0.3; a<results.S_wektor[i-1]+szuk_przed; a++)
                {  
                    pomocniczySQ.push_back(sygnal[a]);
                }
            }

        // szukanie max lub min
        max_war=abs(pomocniczySQ[0]);
         max_poz=0;
         iterator=0;

        for (int a=0; a<pomocniczySQ.size(); a++)
        {
            if (pomocniczySQ[a] < 0)
             {pomocniczySQ[a]=pomocniczySQ[a]*(-1);}
        }



         while (iterator<pomocniczySQ.size())
         {

                if (pomocniczySQ[iterator]>max_war)
                {
                    max_war=pomocniczySQ[iterator];
                    max_poz=iterator;
                    
                }


             iterator=iterator+1;

         }


         if (i==0)
         {
             results.T_wektor.push_back(max_poz+szuk_przed*0.3); 
         }
         else
         {
             results.T_wektor.push_back(results.S_wektor[i-1]+max_poz+szuk_przed*0.3); 
         }

          // QRS_end
        okno=0;
         while(results.S_wektor[i-1]+okno>0 && results.S_wektor[i-1]+okno<results.T_wektor[i])
         {
             if (sygnal[results.S_wektor[i-1]+okno]>sygnal[results.S_wektor[i-1]+okno+1] )//&& sygnal[results.S_wektor[i-1]+okno]>mediana
             {results.QRSend_wektor.push_back(results.S_wektor[i-1]+okno); break;}

             okno=okno+1;
         }





        
   }


        

    

    return results;
}

int main() {
    
    OutputData outputData = doCalculations();

    for (auto i : outputData.QRSend_wektor)
    {
        std::cout<<i<<std::endl;
    }
    
}
